import React from 'react'

export default function search(props) {
    return (
        <>
            <div class="input-group" style={{color:props.mode==='dark'?'white':'black',
        backgroundColor:props.mode==='dark'?'#212529':'white'}}>
                <input type="search" class="form-control rounded" placeholder="Search here for any city or country" aria-label="Search" aria-describedby="search-addon" />
                <button type="button" class="btn btn-outline-primary">search</button>
            </div>

        </>
    )
}
